            char openFrame = '[';
            char closeFrame = ']';
            char barFilling = '#';
            char barEmpty = ' ';

            Console.SetCursorPosition(0, barPosition);
            Console.Write(openFrame);

            for (int i = 0; i < value; i++)
            {
                Console.Write(barFilling);
            }

            for (int i = value; i < totalValue; i++)
            {
                Console.Write(barEmpty);
            }

            Console.Write(closeFrame);
            Console.WriteLine();
        }
    }
}

